    bridges = 0
    for i in range(N):
        visited = [False] * N
        dfs = [False] * N
        stack = []
        dfs[i] = True
        stack.append(i)
        while stack:
            v = stack[-1]
            if dfs[v]:
                visited[v] = True
                stack.pop()
                for w in adjacency_list[v]:
                    if not visited[w]:
                        dfs[w] = True
                        stack.append(w)
            else:
                for w in adjacency_list[v]:
                    if visited[w] and not dfs[w]:
                        bridges += 1
                dfs[v] = True

    return str(bridges)

