    for i in range(N):
        for j in range(N):
            if board[i][j] == 'K':
                knight_pos = (i, j)
                break

    def is_valid(pos):
        return 0 <= pos[0] < N and 0 <= pos[1] < N and board[pos[0]][pos[1]] != '#'

    def bfs(start, end):
        visited = set()
        queue = [(start, 0)]
        while queue:
            (node, dist) = queue.pop(0)
            if node == end:
                return dist
            if node in visited:
                continue
            visited.add(node)
            for neighbor in [(node[0] + 2, node[1] + 1), (node[0] + 2, node[1] - 1), (node[0] - 2, node[1] + 1), (node[0] - 2, node[1] - 1), (node[0] + 1, node[1] + 2), (node[0] + 1, node[1] - 2), (node[0] - 1, node[1] + 2), (node[0] - 1, node[1] - 2)]:
                if is_valid(neighbor):
                    queue.append((neighbor, dist + 1))

    min_steps = bfs(knight_pos, (0, 0))
    if min_steps is None:
        return '-1'
    else:
        return str(min_steps)

